export const serializeData = (apiResponse) => {
    console.log("api..", apiResponse);
    return {
        imdbID: apiResponse.id,
        Poster: apiResponse.poster,
        Type: apiResponse.type,
        Title: apiResponse.title,
        Year : apiResponse.year
    };

}
